"use strict";const GOODS=[{title:"Shirt",price:150},{title:"Socks",price:50},{title:"Jacket",price:350},{title:"Shoes",price:250}],renderGoodsItem=(e,t)=>`<div class="goods-list__item"><h3>${e}</h3><p>${t}</p></div>`,renderGoodsList=e=>{let t=e.map(e=>renderGoodsItem(e.title,e.price));document.querySelector(".goods-list").innerHTML=t.join("")};renderGoodsList(GOODS);